/**
 * 力扣：https://leetcode.cn/problems/remove-all-adjacent-duplicates-in-string/description/
 */

let str =
    "";
function removeDuplicates(s: string): string {
    let arr = Array.from(s);
    let len = arr.length;
    let temp = [];
    for (let index = 0; index < len; index++) {
        if (temp.length > 0 && temp[temp.length - 1] == arr[index]) {
            temp.pop()
        }else{
            temp.push(arr[index])
        }
    }
    return temp.join("");
}

console.log(removeDuplicates(str));
